INSERT INTO `game_play` VALUES ('1100319556389306368', '前三', 'JX11X5', 321.75, 'Q3ZUX', '从01-11共11个号码中选择3个不重复的号码组成一注，所选号码与当期顺序摇出的5个号码中 的前3个号码相同（顺序不限），即为中奖。<br>中奖实例:<br>开奖号码：7,8,9,*,* 投注号码：7,8,9', '前三组选', '组选', 2, '1', 2, '1');
INSERT INTO `game_play` VALUES ('1100319556301225984', '前三', 'JX11X5', 1930.5, 'Q3ZX', '<div>从01-11共11个号码中选择3个不重复的号码组成一注，所选号码与当期顺序摇出的5个号码中 的前3个号码相同，且顺序一致，即为中奖。<br>中奖实例:<br>开奖号码：7,8,9,*,* 投注号码：7,8,9</div>', '前三直选', '直选', 1, '1', 2, '1');
INSERT INTO `game_play` VALUES ('1095237477599281152', '不定胆', 'CQSSC', 6.642, 'H31M', '从0-9中至少选择1个号码作为一注，开奖号码后三位中包含这个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：**3xx      投注号码：3', '后三一码', '不定位', 41, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477641224192', '不定胆', 'CQSSC', 33.33, 'H32M', '从0-9中至少选择2个号码作为一注，开奖号码后三位中包含这2个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：**32x      投注号码：3,2', '后三二码', '不定位', 42, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477674778624', '不定胆', 'CQSSC', 5.234, '4X1M', '从0-9中至少选择1个号码投注，竞猜开奖号码后四位中包含这个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：**7**投注号码：7', '四星一码', '不定位', 43, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477708333056', '不定胆', 'CQSSC', 18.48, '4X2M', '从0-9中至少选择2个号码投注，竞猜开奖号码后四位中包含这2个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：*7*2*投注号码：7,2', '四星二码', '不定位', 44, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477741887488', '不定胆', 'CQSSC', 12.266, '5X2M', '从0-9中至少选择2个号码投注，竞猜开奖号码中包含这2个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：*7*2*投注号码：7,2', '五星二码', '不定位', 45, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477775441920', '不定胆', 'CQSSC', 41.379, '5X3M', '从0-9中至少选择3个号码投注，竞猜开奖号码中包含这3个号码，包含即中奖。<br/>中奖实例:<br/>开奖号码：*7*21投注号码：7,2,1', '五星三码', '不定位', 46, '1', 1, '1');
INSERT INTO `game_play` VALUES ('1095237477804802048', '任选', 'CQSSC', 180, 'R2ZX', '在万位、千位、百位、十位、个位上的任意两个位置，各选1个号码组成一注，号码和顺序都一致即中奖。<br/>中奖实例:<br/>开奖号码：2*3**      投注号码：万位：2 百位：3', '任二直选', '任选二', 47, '1', 1, '1');
